import React, { Component } from "react";

const token = localStorage.getItem("token");

class MyCart extends Component {
  constructor(props) {
    super(props);
    this.state = {
      products: [],
      itemcount: "",
      display: false,
    };
  }
  componentDidMount() {
    if (token == null) {
      this.props.history.push({
        pathname: "/signin",
      });
    }
  }

  render() {
    return (
      <div>
        <h1>hii</h1>
      </div>
    );
  }
}

export default MyCart;
